        return true;
    }

    function verifyTx(
        uint[2] memory input,
        uint[2] memory a,
        uint[2][2] memory b,
        uint[2] memory c
    ) public view returns (bool) {
        Proof memory proof;
        proof.A = G1Point(a[0], a[1]);
        proof.B = G2Point([b[0][0], b[0][1]], [b[1][0], b[1][1]]);
        proof.C = G1Point(c[0], c[1]);
        return verify(input, proof);
    }
}
